import { Container } from "@chakra-ui/react";
import {Table, Thead, Tbody, Tr, Th, Td } from "@chakra-ui/react"
import Navbar from '../components/Navbar'
import { useState, useEffect } from 'react';
import {
    Link,
} from "react-router-dom";

const Student = () => {
    // TODO: answer here
    const [students, setStudents] = useState([])
    const [studentNoChange, setStudentNoChange] = useState()

    const fetchStudents = async () => {
        fetch(`http://localhost:3001/student`)
        .then(response => response.json())
        .then((response) => {
            setStudents(response)
            setStudentNoChange(response)
        })
    }

    const searchStudents = async (search = '') => {
        if (search === '') {
            setStudents(studentNoChange)
        } else {
            let objectStudents = Object.assign([], studentNoChange)
            objectStudents = objectStudents.filter(val => val.faculty === search)
            setStudents(objectStudents)
        }
    }

    const handleFilter = (e) => searchStudents(e.target.value)

    const deleteStudent = async (id) => {
        fetch(`http://localhost:3001/student/${id}`, {
            method: "DELETE",
        })
        .then(response => response.json())
        .then(() => {
            fetchStudents()
        });
    }

    useEffect(() => {
        fetchStudents()
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])

    return (
        <>
            <Navbar menu='student' />
            <Container>
                <Row>
                    <Col md={{ span: 3, offset: 9 }} className='mb-2 text-right'>
                        <Form.Select onChange={handleFilter} data-testid="filter">
                            <option value=''>All</option>
                            <option value="Fakultas Ekonomi">Fakultas Ekonomi</option>
                            <option value="Fakultas Ilmu Sosial dan Politik">Fakultas Ilmu Sosial dan Politik</option>
                            <option value="Fakultas Teknik">Fakultas Teknik</option>
                            <option value="Fakultas Teknologi Informasi dan Sains">Fakultas Teknologi Informasi dan Sains</option>
                        </Form.Select>
                    </Col>
                    <Col md={12}>
                        <Table striped bordered responsive className='text-center' id='table-student'>
                            <Thead>
                                <Tr>
                                    <Th>NO</Th>
                                    <Th>FULLNAME</Th>
                                    <Th>FACULTY</Th>
                                    <Th>PROGRAM STUDY</Th>
                                    <Th>OPTION</Th>
                                </Tr>
                            </Thead>
                            <Tbody>
                                {
                                    students.length > 0 ? students.map((student, key) => (
                                    <Tr className='student-data-row' key={`student-${key}`}>
                                        <Td>{key + 1}</Td>
                                        <Td><Link style={{ textDecoration: 'none' }} to={`/student/${student.id}`}>{student.fullname}</Link></Td>
                                        <Td>{student.faculty}</Td>
                                        <Td>{student.programStudy}</Td>
                                        <Td>
                                            <Button onClick={() => deleteStudent(student.id)} variant="danger" data-testid={`delete-${student.id}`}>Delete</Button>
                                        </Td>
                                    </Tr>)) : <Tr><Td colSpan={5}>Loading ...</Td></Tr>
                                }
                            </Tbody>
                        </Table>
                    </Col>
                </Row>
            </Container>
        </>
    );
};

export default Student;
